import { Link } from "react-router-dom";
import React from "react";

/*
ITP 404, Final
Author: Carson Wang
Email: carsonw@usc.edu
Navigation Bar to display on top of every page
*/

export default function Navigation() {
  return (
    // Primary navigation container
    <div className="navigationBar">
      {/* Ensures consistent spacing and layout */}
      <div className="nav-container">
        {/* Logo and brand name with link to homepage */}
        <div className="logo">
          Winter Wanderlust
        </div>
        <div className="items">
          <Link to="/" className="item">
            Home
          </Link>
          <Link to="/my-trips" className="item">
            My Trips
          </Link>
          <Link to="/savedResorts" className="item">
            Saved Resorts
          </Link>
          <Link to="/admin" className="item">
            Admin
          </Link>
        </div>
      </div>
    </div>
  );
}
